function Nav(){
    return(
        <nav>
            <a href="/">Home</a>
            <a href="/services">Services</a>
            <a href="/work">Work</a>
            <a href="/about">About</a>
            <a href="/contact">Contact</a>
        </nav>
    );
}

export default Nav;
